import Notes from './Notes'

const MusicMakerSheet = ({notes, arraysLists, instrumentLists, currentInstrument, noteLength }) => {
  return (
    <div id="noteSection" className="test flex flex-row border-solid border-2 border-sky-500 w-[80rem] h-[12rem]">
      <div className='flex pl-36 mt-5'>
        {noteLength.map((item, index) => (
          <NoteLength key={index} item={item} column={index} noteLength={noteLength}/>
        ))}
      </div>  
        <Notes notes={notes} arraysLists={arraysLists} instrumentLists={instrumentLists} currentInstrument={currentInstrument}/>

    </div>
  )
}

export default MusicMakerSheet
